// Janela.jsx
import React from "react";

function Janela({ dados }) {
  return (
    <div className="janela">
      <h2>Clientes</h2>
      {/* Exibe os dados formatados */}
      {dados ? (
        <pre>{JSON.stringify(dados, null, 2)}</pre>
      ) : (
        <p>Carregando dados...</p>
      )}
    </div>
  );
}

export default Janela;
